    import Scanner from './Scanner.jsx'; // Ensure this path is correct

    function App() {
      return (
        <div className="min-h-screen bg-gray-900 text-white p-4 font-sans antialiased">
          <header className="text-center mb-8">
            <h1 className="text-4xl font-extrabold text-blue-400 mb-2">Crypto Arbitrage Scanner</h1>
            <p className="text-lg text-gray-400">Discover profit opportunities across exchanges</p>
          </header>

          <main className="max-w-6xl mx-auto bg-gray-800 rounded-lg shadow-xl p-6 md:p-8">
            <Scanner />
          </main>

          <footer className="text-center mt-12 text-gray-500 text-sm">
            <p>&copy; 2025 Crypto Arbitrage Scanner. All rights reserved.</p>
            <p>Data provided by various cryptocurrency exchanges.</p>
          </footer>
        </div>
      );
    }

    export default App;
